import React from "react";
import * as moment from "moment";
import { Nav, Navbar, Button, NavDropdown, Dropdown } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCalendarAlt } from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";



const TopNavigation = () => {
  const currentDate = moment().format("MMMM Do YYYY");

  return (
    <Navbar bg="light" expand="lg" className="fixed-top shadow flexible-navbar">
      {/* <Navbar.Brand href="#home" className="col-sm-3 col-md-2 mr-0">React-Bootstrap</Navbar.Brand> */}
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <NavDropdown title="Menu" id="basic-nav-dropdown" className="ml-4">
            <Link to="/dashboard/about" className="ml-4">About</Link>
            <br/>
            <Link to="/dashboard/skills" className="ml-4">Knowledge</Link>
            <br/>
            <Link to="/dashboard/documents" className="ml-4">Documents</Link>
            <br/>
            <Link to="/dashboard/contact" className="ml-4">Contact</Link>
            <br/>
            <NavDropdown.Divider />
            <Link to="/" className="ml-4">Back to Main</Link>
            <br/>
          </NavDropdown>
        </Nav>
        <Nav className="mr-3">
          <NavDropdown title="Follow me" id="basic-nav-dropdown" className="ml-4">
          <Dropdown.Item href="#/action-2"><span className="fab fa-github-square text-secondary" style={{fontSize:"20px"}}></span>kk</Dropdown.Item>
            <br/>
            <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
            <br/>
            <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
            <br/>
            <NavDropdown.Divider />
            <Link to="/" className="ml-4">Back</Link>
            <br/>
          </NavDropdown>
        </Nav>
        <Button
          href="#"
          variant="outline-info"
          disabled
          style={{ pointEvents: "none" }}
        >
          <FontAwesomeIcon icon={faCalendarAlt} className="mr-2" />
          {currentDate}
        </Button>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default TopNavigation;
